import React from "react";






class Canlendar  extends React.Component{
	constructor(){
		super();
	}


	render(){
		return (
			<div className="canlendarChooser">
				<h4>2019年4月</h4>
				<table>
					<tr>
						{["周日","周一","周二","周三","周四","周五","周六"].map((item)=>{
							return <th>{item}</th>
						})}
					</tr>
					<tr>
						<td>1</td>
						<td>2</td>
						<td>3</td>
						<td>4</td>
						<td>5</td>
						<td>6</td>
						<td>7</td>
					</tr>
				</table>
			</div>
		)
	}    

}

export default Canlendar;
